Государство Индонезия — крупнейший в мире архипелаг, протяжённостью с запада на восток — 5120 км, с севера на юг — 1760 км. Через архипелаг или южнее него проходят основные морские пути из Индийского океана в Тихий. Официальная статистика насчитывает в Индонезии 17 804 острова; из них населённых около 6000, 7870 поименованных и 9634 безымянных. Индонезия включает в себя 5 основных островов, 2 крупных (Малые Зондские и Молуккские острова) и 30 небольших архипелагов. Самые крупные острова — Новая Гвинея, Калимантан (Борнео), Суматра, Сулавеси (Целебес) и Ява. Остальные острова имеют гораздо меньшую площадь. Страна лежит по обе стороны от экватора. Архипелаг разделяет Тихий и Индийский океаны. Площадь Индонезии: 
* общая — 1 919 440 км²; 
* суша — 1 826 440 км²; 
* внутренние воды — 93 000 км². Общая протяжённость сухопутной границы 2830 км, из них с Малайзией — 1782 км, с Папуа — Новой Гвинеей — 820 км, с Восточным Тимором — 228 км. Береговая линия: 54 716 км. Самая высокая точка Индонезии — гора Джая (4884 м), вторая по высоте — гора Мандала (4760 м). Только около 10 % всей территории пригодно для сельского хозяйства.
